import './App.css';
import Index from './pages/Index';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from './components/Header';
import Footer from './components/Footer';



function App() {
  return (
    <div className="App">    
      <BrowserRouter>
      <Header/>
      <Routes>
        <Route path='/' element={<Index/>}/>
      </Routes>
      <Footer/>
      </BrowserRouter>
     <Index/>
    </div> 
  );
}

export default App;
